import React from "react";
import styled from "styled-components";

const Players = ({ players }) => {
  return (
    <>
      {players.map((player) => (
        <div>{player.name}</div>
      ))}
    </>
  );
};

export default Players;

const PlayerImg = styled.image`
  width: 3rem;
  height: 3rem;
  object-fit: cover;
`;
